import React from "react";

function Header() {
  return (
    <header
      style={{
        position: "relative",
        width: "100%",
        height: "100vh",
        overflow: "hidden",
        color: "#fff",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        textAlign: "center",
        fontFamily: "'Poppins', sans-serif",
      }}
    >
      {/* Background Video */}
      <video
        src="https://cdn.pixabay.com/vimeo/330202633/abstract-22791.mp4?width=1280&hash=5dc0a0ef37c6a4b81c09ee3bb3921a67c85b23cb"
        loop
        autoPlay
        muted
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          objectFit: "cover",
          zIndex: "-2",
        }}
      ></video>

      {/* Overlay */}
      <div
        className="headerbg"
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          background: "rgba(0, 0, 0, 0.5)",
          zIndex: "-1",
        }}
      ></div>

      {/* Logo */}
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg"
        alt="NeoTect Logo"
        style={{
          width: "100px",
          marginBottom: "20px",
          filter: "drop-shadow(0 0 10px #00ffff)",
        }}
      />

      {/* Title */}
      <h1
        style={{
          fontSize: "3rem",
          marginBottom: "20px",
          letterSpacing: "2px",
          textShadow: "0px 0px 10px #00ffff",
        }}
      >
        Welcome to <span style={{ color: "#00ffff" }}>NeoTect.com</span>
      </h1>

      {/* Buttons */}
      <div className="row" style={{ display: "flex", gap: "20px" }}>
        <button
          className="btn"
          style={{
            background: "linear-gradient(90deg, #00ffff, #007bff)",
            border: "none",
            color: "#fff",
            padding: "12px 28px",
            borderRadius: "30px",
            fontSize: "1rem",
            cursor: "pointer",
            fontWeight: "bold",
            transition: "all 0.3s ease",
          }}
          onMouseOver={(e) =>
            (e.target.style.background = "linear-gradient(90deg, #007bff, #00ffff)")
          }
          onMouseOut={(e) =>
            (e.target.style.background = "linear-gradient(90deg, #00ffff, #007bff)")
          }
        >
          Sign Up
        </button>

        <button
          className="btn"
          style={{
            background: "transparent",
            border: "2px solid #00ffff",
            color: "#00ffff",
            padding: "12px 28px",
            borderRadius: "30px",
            fontSize: "1rem",
            cursor: "pointer",
            fontWeight: "bold",
            transition: "all 0.3s ease",
          }}
          onMouseOver={(e) => {
            e.target.style.background = "#00ffff";
            e.target.style.color = "#000";
          }}
          onMouseOut={(e) => {
            e.target.style.background = "transparent";
            e.target.style.color = "#00ffff";
          }}
        >
          Log In
        </button>
      </div>
    </header>
  );
}

export default Header;
